import "./intro.scss"

export default function intro() {
    return (
        <div className="intro" id="intro">
            <div className="left">
                <div className="imgContainer"></div>
                <img src="assets/girl.png" alt="" />
            </div>
            <div className="right"></div>
        </div>
    )
}
